/** Immediately switch to a different input stream.
 * @param input_file A readable stream.
 * 
 * @note This function does not reset the start condition to @c INITIAL .
 */
void
csql_yyrestart (FILE * input_file)
{

  if (!YY_CURRENT_BUFFER)
    {
      csql_yyensure_buffer_stack ();
      YY_CURRENT_BUFFER_LVALUE =
	csql_yy_create_buffer (csql_yyin, YY_BUF_SIZE);
    }

  csql_yy_init_buffer (YY_CURRENT_BUFFER, input_file);
  csql_yy_load_buffer_state ();
}

/** Switch to a different input buffer.
 * @param new_buffer The new input buffer.
 * 
 */
void
csql_yy_switch_to_buffer (YY_BUFFER_STATE new_buffer)
{

  /* TODO. We should be able to replace this entire function body
   * with
   *              csql_yypop_buffer_state();
   *              csql_yypush_buffer_state(new_buffer);
   */
  csql_yyensure_buffer_stack ();
  if (YY_CURRENT_BUFFER == new_buffer)
    return;

  if (YY_CURRENT_BUFFER)
    {
      /* Flush out information for old buffer. */
      *(yy_c_buf_p) = (yy_hold_char);
      YY_CURRENT_BUFFER_LVALUE->yy_buf_pos = (yy_c_buf_p);
      YY_CURRENT_BUFFER_LVALUE->yy_n_chars = (yy_n_chars);
    }

  YY_CURRENT_BUFFER_LVALUE = new_buffer;
  csql_yy_load_buffer_state ();

  /* We don't actually know whether we did this switch during
   * EOF (csql_yywrap()) processing, but the only time this flag
   * is looked at is after csql_yywrap() is called, so it's safe
   * to go ahead and always set it.
   */
  (yy_did_buffer_switch_on_eof) = 1;
}

static void
csql_yy_load_buffer_state (void)
{
  (yy_n_chars) = YY_CURRENT_BUFFER_LVALUE->yy_n_chars;
  (yytext_ptr) = (yy_c_buf_p) = YY_CURRENT_BUFFER_LVALUE->yy_buf_pos;
  csql_yyin = YY_CURRENT_BUFFER_LVALUE->yy_input_file;
  (yy_hold_char) = *(yy_c_buf_p);
}

/** Allocate and initialize an input buffer state.
 * @param file A readable stream.
 * @param size The character buffer size in bytes. When in doubt, use @c YY_BUF_SIZE.
 * 
 * @return the allocated buffer state.
 */
YY_BUFFER_STATE
csql_yy_create_buffer (FILE * file, int size)
{
  YY_BUFFER_STATE b;

  b = (YY_BUFFER_STATE) csql_yyalloc (sizeof (struct yy_buffer_state));
  if (!b)
    YY_FATAL_ERROR ("out of dynamic memory in csql_yy_create_buffer()");

  b->yy_buf_size = size;

  /* yy_ch_buf has to be 2 characters longer than the size given because
   * we need to put in 2 end-of-buffer characters.
   */
  b->yy_ch_buf = (char *) csql_yyalloc (b->yy_buf_size + 2);
  if (!b->yy_ch_buf)
    YY_FATAL_ERROR ("out of dynamic memory in csql_yy_create_buffer()");

  b->yy_is_our_buffer = 1;

  csql_yy_init_buffer (b, file);

  return b;
}

/** Destroy the buffer.
 * @param b a buffer created with csql_yy_create_buffer()
 * 
 */
void
csql_yy_delete_buffer (YY_BUFFER_STATE b)
{

  if (!b)
    return;

  if (b == YY_CURRENT_BUFFER)	/* Not sure if we should pop here. */
    YY_CURRENT_BUFFER_LVALUE = (YY_BUFFER_STATE) 0;

  if (b->yy_is_our_buffer)
    csql_yyfree ((void *) b->yy_ch_buf);

  csql_yyfree ((void *) b);
}

